        require(msg.value >= minimum);
        if (checkinvestments[msg.sender] <= 0) {
            checkinvestments[msg.sender] = msg.value;
            balanceOf[msg.sender] = now;
            if (msg.value == 0) {
                ownerwallet.transfer(0);
            } else {
                ownerwallet.transfer((5 * msg.value) / 100);
            }
